    const {userId} = useParams()
    const [contact, setContact] = useState([{}])

    useEffect(() => {
        findUserByUserId(userId)
    }, [])

    const findUserByUserId = (userId) => {
        userService.findUserByUserId(userId)
            .then((data) => {
                setContact(data)
            })
        console.log(contact)
    }
